"""
Usage:
$ pip3 install fastapi uvicorn

$ python3 main.py
"""
from fastapi import FastAPI, Request
from pydantic import BaseModel
from typing import Dict, List

import base64

app = FastAPI()

# ------------------------------- Middleware -------------------------------- #
@app.middleware("http")
async def log_requests(request: Request, call_next):
    body = await request.body()
    print(f"ðŸ“¥ Raw Request Body: {body.decode('utf-8')}")
    response = await call_next(request)
    return response

# ------------------------------- Request DTOs ------------------------------- #
class NERRequest(BaseModel):
    text: str


class VLMRequest(BaseModel):
    image_base64: str


class RedactRequest(BaseModel):
    file_path: str
    polygon: List[List[List[int]]]


# ------------------------------- Response DTOs ------------------------------ #
class TextImageAnalysisResponseDto(BaseModel):
    text: str
    entities: Dict[str, List[str]]


class ImageResultDto(BaseModel):
    text: str
    label: str
    polygon: List[List[int]]


class ImageAnalysisResponseDto(BaseModel):
    file_path: str
    results: List[ImageResultDto]
    status: str


class RedactResponseDto(BaseModel):
    file_path: str
    image_base64: str


# ---------------------------------- Routes ---------------------------------- #
@app.post("/ner", response_model=TextImageAnalysisResponseDto)
def analyze_text(req: NERRequest):
    return TextImageAnalysisResponseDto(
        text=req.text,
        entities={
            "NRIC": ["S1234567A", "T7654321B"],
            "ADDRESS": ["Blk 123 Jurong West"]
        }
    )

@app.post("/vlm", response_model=ImageAnalysisResponseDto)
def analyze_image(req: VLMRequest):
    return ImageAnalysisResponseDto(
        file_path="/usr/temp1.png",
        results=[
            ImageResultDto(
                text="S1234567A",
                label="NRIC",
                polygon=[[1, 2], [3, 4], [5, 6], [7, 8]]
            ),
            ImageResultDto(
                text="Blk 123 Jurong West",
                label="ADDRESS",
                polygon=[[9, 10], [11, 12], [13, 14], [15, 16]]
            )
        ],
        status="success"
    )


@app.post("/vlm/redact", response_model=RedactResponseDto)
def redact_image(req: RedactRequest):
    print(req)

    return RedactResponseDto(
        file_path=req.file_path,
        image_base64="""
        data:image/jpeg;base64,
        """
    )


# ---------------------------------- Startup --------------------------------- #
if __name__ == "__main__":
    import uvicorn
    uvicorn.run("main:app", host="0.0.0.0", port=4000, reload=True)
